    import React, { Component } from 'react';
    import {
      AppRegistry,
      StyleSheet,
      Text,
      View,
      TabBarIOS
    } from 'react-native';

    var HomePageView = require('./HomePageView');
    // var NewsListView = require('./NewsListView');
    // var FoodListView = require('./FoodListView');
    // var SiteListView = require('./SiteListView');

    var base64IconHome = 'data:image/png;base64,';
    var base64IconNews = 'data:image/png;base64,';
    var base64IconFood = 'data:image/png;base64,';
    var base64IconSite = 'data:image/png;base64,';


    class lifehelper extends Component {

      constructor(props){
        super(props);
        this.state={
          selectedTab:'首页',
          titleText:'生活帮'
        };
      }

      //切换TAB进行渲染页面内容
      _renderContent(color: string, pageTitle: string, num?: number) {
        switch (pageTitle) {
          case '首页':
          return (
            // <View style={[styles.tabContent, {backgroundColor: color}]}>
            //   <Text style={styles.tabText}>{pageTitle}</Text>
            // </View>
            <HomePageView contextText='首页'/>
          );
            break;
            case '新闻':
            return (
              <View style={[styles.tabContent, {backgroundColor: color}]}>
                <Text style={styles.tabText}>{pageTitle}</Text>
              </View>
            );
              break;
              case '餐饮':
              return (
                <View style={[styles.tabContent, {backgroundColor: color}]}>
                  <Text style={styles.tabText}>{pageTitle}</Text>
                </View>
              );
                break;
                case '景点':
                return (
                  <View style={[styles.tabContent, {backgroundColor: color}]}>
                    <Text style={styles.tabText}>{pageTitle}</Text>
                  </View>
                );
                  break;
          default: break;
        }
      }


      render() {
        return (
          <View style={{flex:1, backgroundColor:"deepskyblue"}}>
            <Text style={styles.welcome}>
              {this.state.titleText}
            </Text>
            <TabBarIOS
            style={{flex:1,alignItems:"flex-end"}}
            tintColor="deepskyblue"
            barTintColor="white">
            <TabBarIOS.Item
              title="首页"
              icon={{uri: base64IconHome, scale:2}}
              selected={this.state.selectedTab === '首页'}
              onPress={() => {
                this.setState({
                  selectedTab: '首页',
                  titleText:'生活帮'
                });
              }}
              >
              {this._renderContent('#ffffff', '首页')}
            </TabBarIOS.Item>
            <TabBarIOS.Item
              icon={{uri: base64IconNews, scale:2}}
              selected={this.state.selectedTab === '新闻'}
              title='新闻'
              onPress={() => {
                this.setState({
                  selectedTab: '新闻',
                  titleText:'新闻'
                });
              }}
              >
              {this._renderContent('#ffffff', '新闻', this.state.notifCount)}
            </TabBarIOS.Item>
            <TabBarIOS.Item
              icon={{uri: base64IconFood, scale:2}}
              title='餐饮'
               selected={this.state.selectedTab === '餐饮'}
                onPress={() => {
                this.setState({
                  selectedTab: '餐饮',
                  titleText:'餐饮'
                });
              }}>
               {this._renderContent('#ffffff', '餐饮', this.state.presses)}
            </TabBarIOS.Item>
            <TabBarIOS.Item
              title='景点'
              icon={{uri:base64IconSite, scale:2}}
               selected={this.state.selectedTab === '景点'}
                onPress={() => {
                this.setState({
                  selectedTab: '景点',
                  titleText:'景点'
                });
              }}>
               {this._renderContent('#ffffff', '景点', this.state.presses)}
            </TabBarIOS.Item>

          </TabBarIOS>
          </View>
        );
      }
    }

    const styles = StyleSheet.create({
      container: {
        flex: 1,
        justifyContent: 'center',
        alignItems: 'center',
        backgroundColor: '#F5FCFF',
      },
      welcome: {
        fontSize: 16,
        textAlign: 'center',
        color:'white',
        marginTop:30,
        marginBottom:15
      },
      instructions: {
        textAlign: 'center',
        color: '#333333',
        marginBottom: 5,
      },
      tabContent: {
        flex: 1,
        alignItems: 'center',
      },
      tabText: {
        color: 'deepskyblue',
        margin: 50,
      },
    });

    AppRegistry.registerComponent('lifehelper', () => lifehelper);
